// Process Apollo.io response and extract lead data
const items = [];

if ($input.first().json.people && Array.isArray($input.first().json.people)) {
  for (const person of $input.first().json.people) {
    const leadData = {
      id: person.id,
      first_name: person.first_name,
      last_name: person.last_name,
      title: person.title,
      email: person.email,
      linkedin_url: person.linkedin_url,
      company_name: person.organization?.name || '',
      company_domain: person.organization?.primary_domain || '',
      company_industry: person.organization?.industry || '',
      company_size: person.organization?.estimated_num_employees || 0,
      company_description: person.organization?.short_description || '',
      location: person.city + ', ' + person.state + ', ' + person.country,
      phone: person.phone_numbers?.[0]?.sanitized_number || '',
      source: 'Apollo.io',
      discovered_at: new Date().toISOString()
    };

    items.push({ json: leadData });
  }
}

return items;

// Combine and enrich lead data from multiple sources
const apolloData = $('Process Apollo Data').first().json;
const hunterData = $('Hunter Email Finder').first().json;
const clearbitData = $('Clearbit Enrichment').first().json;

// Merge data with priority: Clearbit > Hunter > Apollo
const enrichedLead = {
  ...apolloData,

  // Email data from Hunter.io
  email: hunterData.data?.email || apolloData.email,
  email_confidence: hunterData.data?.confidence || null,
  email_score: hunterData.data?.score || null,

  // Enhanced data from Clearbit
  bio: clearbitData.person?.bio || '',
  avatar: clearbitData.person?.avatar || '',
  twitter: clearbitData.person?.twitter?.handle || '',
  github: clearbitData.person?.github?.handle || '',

  // Enhanced company data from Clearbit
  company_logo: clearbitData.company?.logo || '',
  company_founded: clearbitData.company?.foundedYear || null,
  company_employees: clearbitData.company?.metrics?.employees || apolloData.company_size,
  company_funding: clearbitData.company?.metrics?.raised || null,
  company_tech: clearbitData.company?.tech || [],

  // Calculate enrichment score
  enrichment_score: (
    (apolloData.email ? 20 : 0) +
    (hunterData.data?.email ? 25 : 0) +
    (clearbitData.person ? 30 : 0) +
    (apolloData.linkedin_url ? 15 : 0) +
    (apolloData.phone ? 10 : 0)
  ),

  enriched_at: new Date().toISOString()
};

return [{ json: enrichedLead }];

