// Count and summarize processed leads
const allLeads = $('Process Apollo Data').all();
const enrichedLeads = $('Merge Enriched Data').all();
const scoredLeads = $('Process AI Scoring').all();
const highQualityLeads = $('Filter High Quality Leads').all();

// Calculate summary statistics
const summary = {
  total_leads_found: allLeads.length,
  enriched_leads: enrichedLeads.length,
  ai_scored_leads: scoredLeads.length,
  high_quality_leads: highQualityLeads.length,
  average_score: scoredLeads.reduce((sum, lead) => sum + (lead.json.final_score || 0), 0) / scoredLeads.length || 0,

  // Score distribution
  score_distribution: {
    high: scoredLeads.filter(lead => (lead.json.final_score || 0) >= 7).length,
    medium: scoredLeads.filter(lead => (lead.json.final_score || 0) >= 4 && (lead.json.final_score || 0) < 7).length,
    low: scoredLeads.filter(lead => (lead.json.final_score || 0) < 4).length
  },

  // Company breakdown
  companies_analyzed: [...new Set(allLeads.map(lead => lead.json.company_name))],

  // Top industries
  industries: [...new Set(allLeads.map(lead => lead.json.company_industry).filter(Boolean))],

  workflow_completed_at: new Date().toISOString()
};

return [{ json: summary }];
